import Tabla from "./Tabla";
import Toast from 'react-hot-toast';

function Libros() {
    if (localStorage.getItem('privilegio') != null && localStorage.getItem('privilegio').length > 0) {
        return [
              <Tabla filas_por_pagina={10} tabla={'libros'}></Tabla>
        ];
    } else {

      Toast.success(
        'No tenes permisos para acceder aca',
        {
          duration: 2000,
        }
      );
      setTimeout(() => {
        window.location = 'http://localhost:3000/Login';
      }, 2500);
  
    }
  
}
export default Libros;
